import React from "react";
import Link from "next/link";

class Index extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1>I am from Index Page!</h1>
        <Link href="/about">
          <a>Home</a>
        </Link>
        <Link href="/portfolios">
          <a>Portolios</a>
        </Link>
        <Link href="/blogs">
          <a>Home</a>
        </Link>
        <Link href="/cv">
          <a>Home</a>
        </Link>
      </React.Fragment>
    );
  }
}

export default Index;
